openapi: 3.1.0
info:
  title: Spendilow Backend API
  contact:
    name: Brian Atzori
    url: https://www.brianatzori.it/
    email: hello@brianatzori.it
  version: '1.0'
jsonSchemaDialect: https://json-schema.org/draft/2020-12/schema
servers:
- url: https://spendilow.brianatzori.it/api/v1
  variables: {}
paths:
  /users/new:
    post:
      tags:
      - users
      summary: Register User
      operationId: RegisterUser
      parameters: []
      requestBody:
        description: ''
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/RegisterUserRequest'
              - examples:
                - email: prova_spendilow@prova.it
                  password: Spendilow@2024
                  savings: 100
                  salary: 1500
                  profileimage: 'data:image/png;base64,'
                  workfield: IT
                  username: Test User
                  isMFAActive: false
              contentMediaType: application/json
            example:
              email: prova_spendilow@prova.it
              password: Spendilow@2024
              savings: 100
              salary: 1500
              profileimage: 'data:image/png;base64,'
              workfield: IT
              username: Test User
              isMFAActive: false
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
      security: []
    parameters: []
  /users/login:
    post:
      tags:
      - users
      summary: Login User
      operationId: LoginUser
      parameters: []
      requestBody:
        description: ''
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/LoginUserRequest'
              - examples:
                - email: prova_spendilow@prova.it
                  password: Spendilow@2024
              contentMediaType: application/json
            example:
              email: prova_spendilow@prova.it
              password: Spendilow@2024
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
      security: []
    parameters: []
  /users/mfa-activation:
    get:
      tags:
      - users
      summary: Activate MFA User
      operationId: ActivateMFAUser
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
      security: []
    parameters: []
  /users/mfa-verification:
    post:
      tags:
      - users
      summary: Verify MFA
      operationId: VerifyMFA
      parameters: []
      requestBody:
        description: You need to trigger the Activate MFA User in order to have a string representing a QR Code to scan with Google Authenticator App
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/VerifyMFARequest'
              - description: You need to trigger the Activate MFA User in order to have a string representing a QR Code to scan with Google Authenticator App
                examples:
                - otp: '576695'
              contentMediaType: application/json
            example:
              otp: '576695'
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
      security: []
    parameters: []
  /utilities/check-server-alive:
    get:
      tags:
      - utilities
      summary: Check Server Alive
      operationId: CheckServerAlive
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
      security: []
    parameters: []
  /authenticated-users/get-profile:
    get:
      tags:
      - authenticated-users
      summary: Get User Profile
      operationId: GetUserProfile
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/mod:
    patch:
      tags:
      - authenticated-users
      summary: Modify User
      operationId: ModifyUser
      parameters: []
      requestBody:
        description: ''
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/ModifyUserRequest'
              - examples:
                - email: prova_edit9@prova.it
                  password: NuovaPassword@2023
                  savings: 1
                  salary: 100
                  profileimage: 'data:image/png;base64,'
                  workfield: Modifica utenti
                  username: Edited
                  isMFAActive: false
              contentMediaType: application/json
            example:
              email: prova_edit9@prova.it
              password: NuovaPassword@2023
              savings: 1
              salary: 100
              profileimage: 'data:image/png;base64,'
              workfield: Modifica utenti
              username: Edited
              isMFAActive: false
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/del:
    delete:
      tags:
      - authenticated-users
      summary: Delete User
      operationId: DeleteUser
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/transactions/new:
    post:
      tags:
      - transactions
      summary: Create Transaction
      operationId: CreateTransaction
      parameters: []
      requestBody:
        description: ''
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/CreateTransactionRequest'
              - examples:
                - transaction_date: 1997/12/01
                  amount: 1
                  title: Spesa
                  notes: Di Natale
                  tags: 2024, famiglia, test
                  transaction_type: Expense
                  target_id: null
              contentMediaType: application/json
            example:
              transaction_date: 1997/12/01
              amount: 1
              title: Spesa
              notes: Di Natale
              tags: 2024, famiglia, test
              transaction_type: Expense
              target_id: null
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/transactions/get/all:
    get:
      tags:
      - transactions
      summary: Get All Transactions
      operationId: GetAllTransactions
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/transactions/get/:
    get:
      tags:
      - transactions
      summary: Get Single Transaction
      description: You should create a transaction and then append the ID after /get/ since the API is routed like /authenticated-users/transactions/get/:id
      operationId: GetSingleTransaction
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/transactions/mod/:
    patch:
      tags:
      - transactions
      summary: Update Single Transaction
      description: You should create a transaction and then append the ID after /mod/ since the API is routed like /authenticated-users/transactions/mod/:id
      operationId: UpdateSingleTransaction
      parameters: []
      requestBody:
        description: ''
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/UpdateSingleTransactionRequest'
              - examples:
                - amount: 120
                  title: Spesa editata
                  notes: Modificata per test
                  tags: Testing
                  target_id: null
              contentMediaType: application/json
            example:
              amount: 120
              title: Spesa editata
              notes: Modificata per test
              tags: Testing
              target_id: null
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/transactions/del/:
    delete:
      tags:
      - transactions
      summary: Delete Single Transaction
      description: You should create a transaction and then append the ID after /del/ since the API is routed like /authenticated-users/transactions/del/:id
      operationId: DeleteSingleTransaction
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/budgets/new:
    post:
      tags:
      - budget
      summary: Create Budget
      operationId: CreateBudget
      parameters: []
      requestBody:
        description: ''
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/CreateBudgetRequest'
              - examples:
                - name: Nuovo Budget
                  description: Il budget di test
              contentMediaType: application/json
            example:
              name: Nuovo Budget
              description: Il budget di test
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/budgets/get/all:
    get:
      tags:
      - budget
      summary: Get All Budgets
      operationId: GetAllBudgets
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/budgets/get/:
    get:
      tags:
      - budget
      summary: Get Single Budget
      description: You should create a budget and then append the ID after /get/ since the API is routed like /authenticated-users/budgets/get/:id
      operationId: GetSingleBudget
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/budgets/mod/:
    patch:
      tags:
      - budget
      summary: Update Single Budget
      description: You should create a budget and then append the ID after /mod/ since the API is routed like /authenticated-users/budgets/get/:id
      operationId: UpdateSingleBudget
      parameters: []
      requestBody:
        description: ''
        content:
          application/json:
            schema:
              allOf:
              - $ref: '#/components/schemas/UpdateSingleBudgetRequest'
              - examples:
                - name: Budget modificato
                  description: Modifica
              contentMediaType: application/json
            example:
              name: Budget modificato
              description: Modifica
        required: true
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
  /authenticated-users/budgets/del/:
    delete:
      tags:
      - budget
      summary: Delete Single Transaction
      description: You should create a budget and then append the ID after /del/ since the API is routed like /authenticated-users/budgets/get/:id
      operationId: DeleteSingleTransaction1
      parameters: []
      responses:
        '200':
          description: ''
          headers: {}
      deprecated: false
    parameters: []
components:
  schemas:
    RegisterUserRequest:
      title: RegisterUserRequest
      required:
      - email
      - password
      - savings
      - salary
      - profileimage
      - workfield
      - username
      - isMFAActive
      type: object
      properties:
        email:
          type: string
        password:
          type: string
        savings:
          type: number
        salary:
          type: number
        profileimage:
          type: string
        workfield:
          type: string
        username:
          type: string
        isMFAActive:
          type: boolean
      examples:
      - email: prova_spendilow@prova.it
        password: Spendilow@2024
        savings: 100
        salary: 1500
        profileimage: 'data:image/png;base64,'
        workfield: IT
        username: Test User
        isMFAActive: false
    LoginUserRequest:
      title: LoginUserRequest
      required:
      - email
      - password
      type: object
      properties:
        email:
          type: string
        password:
          type: string
      examples:
      - email: prova_spendilow@prova.it
        password: Spendilow@2024
    VerifyMFARequest:
      title: VerifyMFARequest
      required:
      - otp
      type: object
      properties:
        otp:
          type: string
      examples:
      - otp: '576695'
    ModifyUserRequest:
      title: ModifyUserRequest
      required:
      - email
      - password
      - savings
      - salary
      - profileimage
      - workfield
      - username
      - isMFAActive
      type: object
      properties:
        email:
          type: string
        password:
          type: string
        savings:
          type: integer
          contentEncoding: int32
        salary:
          type: integer
          contentEncoding: int32
        profileimage:
          type: string
        workfield:
          type: string
        username:
          type: string
        isMFAActive:
          type: boolean
      examples:
      - email: prova_edit9@prova.it
        password: NuovaPassword@2023
        savings: 1
        salary: 100
        profileimage: 'data:image/png;base64,'
        workfield: Modifica utenti
        username: Edited
        isMFAActive: false
    CreateTransactionRequest:
      title: CreateTransactionRequest
      required:
      - transaction_date
      - amount
      - title
      - notes
      - tags
      - transaction_type
      - target_id
      type: object
      properties:
        transaction_date:
          type: string
        amount:
          type: integer
          contentEncoding: int32
        title:
          type: string
        notes:
          type: string
        tags:
          type: string
        transaction_type:
          type: string
        target_id:
          type:
          - string
          - 'null'
      examples:
      - transaction_date: 1997/12/01
        amount: 1
        title: Prova Postman
        notes: Prova Postman
        tags: Prova Postman
        transaction_type: Expense
        target_id: null
    UpdateSingleTransactionRequest:
      title: UpdateSingleTransactionRequest
      required:
      - amount
      - title
      - notes
      - tags
      - target_id
      type: object
      properties:
        amount:
          type: integer
          contentEncoding: int32
        title:
          type: string
        notes:
          type: string
        tags:
          type: string
        target_id:
          type:
          - string
          - 'null'
      examples:
      - amount: 120
        title: Prova Postman MODIFICATO 2
        notes: Prova Postman
        tags: Prova Postman
        target_id: null
    CreateBudgetRequest:
      title: CreateBudgetRequest
      required:
      - name
      - description
      type: object
      properties:
        name:
          type: string
        description:
          type: string
      examples:
      - name: Nuovo Budget
        description: Il budget di test
    UpdateSingleBudgetRequest:
      title: UpdateSingleBudgetRequest
      required:
      - name
      - description
      type: object
      properties:
        name:
          type: string
        description:
          type: string
      examples:
      - name: Budget modificato
        description: Modifica
  securitySchemes:
    httpBearer:
      type: http
      scheme: bearer
security:
- httpBearer: []
tags:
- name: users
- name: utilities
- name: authenticated-users
- name: transactions
- name: budget
